def 获取数据(url):

    html = etree.HTML(getHTMLText(url))
    测试 = html.xpath("/html/body/div[1]/div//table/tbody//tr//td[1]/text()")
    价格 = [i for i in 测试]
    测试1 = html.xpath("/html/body/div[1]/div//table/tbody//tr//td[2]/text()")
    数量 = [i for i in 测试1]
    标准 = [[价格[i],数量[i]] for i in range(len(价格))]
    return 标准


    
def 获得url():
    r = tkinter.Tk()
    r.withdraw()
    try:
        st = r.clipboard_get().split('\n')[1]
        for i in list1:
            if st == i["ch_name"]:
                name = st
                url = f'http://poedb.tw/tw/unique.php?n={i["en_name"]}'
                #text1.delete(0.0, tkinter.END)
                #text1.insert(tkinter.INSERT, "OK正在打开网页")
                #webbrowser.open(url)
                res = [name,url]
                return res
        else:
            text1.delete(0.0, tkinter.END)
            text1.insert(tkinter.INSERT, "我居然没有找到这件传奇")
    except:
        text1.delete(0.0, tkinter.END)
        text1.insert(tkinter.INSERT, "你复制这个东西似乎有点问题啊")
